import React, { Component } from 'react';
import GeneralInfoForm from './GeneralInfoForm';
import CallInfoForm from './CallInfoForm';
import CallSummaryForm from './CallSummaryForm';
class InsertPage extends Component {


  cancelInfo(event ){
    this.setState({[isCinfoOnscreen] : false });
    this.forceUpdate();
  }
constructor(props){
  super(props);
  this.state = {
     isGinfoOnscreen: true,
     isCinfoOnscreen: true,
     isCsummaryOnscreen: true,
     
  }
}
  render() {



    if(this.state.isCinfoOnscreen == true && this.state.isGinfoOnscreen == true && isCsummaryOnscreen == true){
      return (
        <div className="InsertPage">
      <GeneralInfoForm/>
      <CallInfoForm/>
      <CallSummaryForm/>
        <button onClick = {this.cancelInfo}> Cancel </button>
  
        </div>
      );
    }
    
    
  }
}

export default InsertPage;
